# setup_cryptoalerts77.ps1
# One-file PowerShell setup for the CryptoAlerts77 Flutter client (Windows)
param(
  [string]$AppDir = "cryptoalerts77",
  [string]$PackageName = "com.cryptoalerts77.app",
  [bool]$RunApp = $false,
  [bool]$BuildAab = $false
)

$ErrorActionPreference = "Stop"

function Require-Cmd($name) {
  if (-not (Get-Command $name -ErrorAction SilentlyContinue)) {
    throw "Required command not found: $name"
  }
}

Require-Cmd "flutter"
Require-Cmd "powershell"

Write-Host "➡️ Creating/updating Flutter project: $AppDir"
if (-not (Test-Path $AppDir)) {
  flutter create $AppDir | Out-Host
}

# Write embedded ZIP to temp
$zipB64 = @"

"@

$tempZip = Join-Path $env:TEMP "cryptoalerts77_ready.zip"
[IO.File]::WriteAllBytes($tempZip, [Convert]::FromBase64String($zipB64))

# Unzip to temp dir
$tempDir = Join-Path $env:TEMP "cryptoalerts77_ready"
if (Test-Path $tempDir) { Remove-Item $tempDir -Recurse -Force }
Expand-Archive -LiteralPath $tempZip -DestinationPath $tempDir -Force

# Copy lib/ and pubspec.yaml
Write-Host "➡️ Copying lib/ and pubspec.yaml"
Copy-Item -Path (Join-Path $tempDir "lib") -Destination $AppDir -Recurse -Force
Copy-Item -Path (Join-Path $tempDir "pubspec.yaml") -Destination $AppDir -Force

# Android files
$androidApp = Join-Path $AppDir "android\app"
$androidSrcMain = Join-Path $androidApp "src\main"
$androidRes = Join-Path $androidSrcMain "res"
New-Item -ItemType Directory -Force -Path $androidApp,$androidSrcMain,$androidRes | Out-Null

Write-Host "➡️ Applying Android manifest, strings (EN/EL), and icons"
Copy-Item -Path (Join-Path $tempDir "ANDROID_FILES\src\main\AndroidManifest.xml") -Destination $androidSrcMain -Force
Copy-Item -Path (Join-Path $tempDir "ANDROID_FILES\src\main\res\values") -Destination $androidRes -Recurse -Force
Copy-Item -Path (Join-Path $tempDir "ANDROID_FILES\src\main\res\values-el") -Destination $androidRes -Recurse -Force

$mipmapFolders = @("mipmap-mdpi","mipmap-hdpi","mipmap-xhdpi","mipmap-xxhdpi","mipmap-xxxhdpi")
foreach ($d in $mipmapFolders) {
  $src = Join-Path (Join-Path $tempDir "ANDROID_FILES\src\main\res") $d
  $dst = Join-Path $androidRes $d
  New-Item -ItemType Directory -Force -Path $dst | Out-Null
  Copy-Item -Path (Join-Path $src "*") -Destination $dst -Force
}

# Set applicationId in build.gradle
$buildGradle = Join-Path $androidApp "build.gradle"
if (Test-Path $buildGradle) {
  Write-Host "➡️ Setting applicationId = $PackageName in $buildGradle"
  $content = Get-Content $buildGradle -Raw
  if ($content -match 'applicationId\s+"[^"]*"') {
    $content = [regex]::Replace($content, 'applicationId\s+"[^"]*"', ('applicationId "' + $PackageName + '"'))
    $content | Set-Content -Path $buildGradle -Encoding UTF8
  } else {
    Write-Warning "applicationId line not found in build.gradle. Please set: applicationId \"$PackageName\""
  }
} else {
  Write-Warning "build.gradle not found at $buildGradle"
}

# flutter pub get
Write-Host "➡️ flutter pub get"
Push-Location $AppDir
try {
  flutter pub get | Out-Host
} finally {
  Pop-Location
}

if ($RunApp) {
  Write-Host "➡️ Running on device/emulator (flutter run)"
  Push-Location $AppDir
  try {
    flutter run
  } finally {
    Pop-Location
  }
}

if ($BuildAab) {
  Write-Host "➡️ Building AAB (flutter build appbundle --release)"
  Push-Location $AppDir
  try {
    flutter build appbundle --release
    Write-Host "✅ AAB at: $AppDir\build\app\outputs\bundle\release\app-release.aab"
  } catch {
    Write-Warning "Build failed. Make sure Android SDK is installed and signing is configured (upload keystore or Play App Signing)."
    throw
  } finally {
    Pop-Location
  }
}

Write-Host "✅ Done. Next steps:"
Write-Host "   cd $AppDir"
Write-Host "   flutter run"
